  private static validationErrorMiddleware: ErrorRequestHandler = (
    error,
    _,
    response,
    next
  ) => {
    if (error instanceof ValidationError) {
      response.status(400).send({
        type: 'REQUEST_VALIDATION_FAILED',
        fields: error.validationErrors
      });
      next();
    } else {
      next(error);
    }
  };

